import React ,{ useState,useEffect } from 'react';
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Row from 'react-bootstrap/Row';
import Container from 'react-bootstrap/esm/Container';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import Image from 'react-bootstrap/Image';



function Save() {

  const ae=localStorage.getItem("a_email");
  var navigate=useNavigate();

  const [obj,updateobj]=useState({email:ae,number:"",city:"",state:"",zip:"",category:"",task:""});
   const [validated, setValidated] = useState(false);
  
  const handleSubmit = (event) => {
    const form = event.currentTarget;
  
    if (form.checkValidity() === false) {
      console.log("false");
      event.preventDefault();
      event.stopPropagation();
      return;
    }
    

     setValidated(true);
      savepost();
  };

  const update=(event)=>{
    var {name,value}=event.target;

    updateobj({...obj,[name]:value});
}


    async function savepost(){
        var url="http://localhost:2002/client/postreq-client-post";
    var formData=new FormData();
    for(var x in obj)
      {
        formData.append(x,obj[x]);
      }
    var response = await axios.post(url,formData);
    alert(JSON.stringify(response.data));
    if(response.data.status)
    {
      navigate("/cdash");
    }
         
    }

    
  return (
    <div>
        <div>
            <br />
            <h1>Provider profile</h1>
            <br />
            <br />
        </div>
    <Container>
    <Form noValidate validated={validated}>
      <Row className="mb-3">
      <Form.Group as={Col} md="4" controlId="validationCustomUsername">
          <Form.Label>Email</Form.Label>
            <Form.Control
              type="text"
              aria-describedby="inputGroupPrepend"
              required
              name='email'
              value={obj.email}
              onChange={update}
              // disabled
            />
            <Form.Control.Feedback type="invalid">
              Please choose a username.
            </Form.Control.Feedback>
        </Form.Group>
      </Row>
      <Row className="mb-3">

        <Form.Group as={Col} md="3" controlId="validationCustom03">
          <Form.Label>Contact Number:</Form.Label>
          <Form.Control 
          type="text" 
          placeholder="Number" 
          required 
          name='number'
          value={obj.number}
          onChange={update}/>
          <Form.Control.Feedback type="invalid">
            Please provide a valid number.
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group as={Col} md="3" controlId="validationCustom03">
          <Form.Label>City</Form.Label>
          <Form.Control 
          type="text" 
          placeholder="City" 
          required 
          name='city'
          value={obj.city} 
          onChange={update}/>
          <Form.Control.Feedback type="invalid">
            Please provide a valid city.
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group as={Col} md="3" controlId="validationCustom04">
          <Form.Label>State</Form.Label>
          <Form.Control 
          type="text" 
          placeholder="State" 
          name='state'
          value={obj.state} 
          onChange={update} 
          required />
          <Form.Control.Feedback type="invalid">
            Please provide a valid state.
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group as={Col} md="3" controlId="validationCustom05">
          <Form.Label>Zip</Form.Label>
          <Form.Control 
          type="text" 
          placeholder="Zip" 
          name='zip'
            value={obj.zip} 
            onChange={update} 
            required />
          <Form.Control.Feedback type="invalid">
            Please provide a valid zip.
          </Form.Control.Feedback>
        </Form.Group>
      </Row>

      <Row className="mb-3">

        <Form.Group as={Col} md="4" controlId="validationCustom03">
          <Form.Label>Category</Form.Label>
            <Form.Select aria-label="Default select example" required 
          name='category'
          value={obj.category}
          onChange={update}>
              <option>Open this select menu</option>
              <option value="Mechanic">Mechanic</option>
              <option value="Electrician">Electrician</option>
              <option value="Plumber">Plumber</option>
              <option value="Baby-sitter">Baby-sitter</option>
              <option value="Milk-man">Milk-man</option>
          </Form.Select>
          <Form.Control.Feedback type="invalid">
            Please provide a valid category.
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group as={Col} md="4" controlId="validationCustom03">
          <Form.Label>Task details</Form.Label>
          <Form.Control 
          type="text" 
          placeholder="task" 
          required 
          name='task'
          value={obj.task} 
          onChange={update}/>
          <Form.Control.Feedback type="invalid">
            Please provide a valid task.
          </Form.Control.Feedback>
        </Form.Group>

       
      </Row>

      
      <Button type="button" onClick={handleSubmit}>Post</Button>
    </Form>
    </Container>
    <p> 
        {JSON.stringify(obj)}  
    </p>
    </div>
  );
}

export default Save;
